import React from "react";
import styled from "styled-components";
import Item from "../Item/Item";

const items = {
  one: {
    id: 1,
    name: "NikeCourt Tech Challenge 20",
    price: "$165",
    newPrice: undefined,
    options: "2 colors",
  },

  two: {
    id: 2,
    name: "NikeCourt Mecton 5 AMP",
    price: "$165",
    newPrice: "$145",
    options: "1 color",
  },
};

const ItemGrid = () => {
  return (
    <Wrapper>
      {items.map((item) => (
        <Item>{item}</Item>
      ))}
    </Wrapper>
  );
};

const Wrapper = styled.div`
  display: flex;
`;

export default ItemGrid;
